import React, { Component } from "react";

import axios from "axios";

// import Dropdown from "react-bootstrap/Dropdown";

export default class Category extends Component {
  constructor(props) {
    super(props);
    this.state = { catname: "" };
  }

  onChangeHandler = (e) => {
    this.setState({
      catname: e.target.value,
    });
  };
  onSubmit = async (e) => {
    e.preventDefault();
    const data = { catname: this.state.catname };
    const body = JSON.stringify(data);
    const token = sessionStorage.getItem("token");
    const config = {
      headers: {
        Authorization: `Bearer ${token}`,
        "Content-Type": "application/json",
      },
    };
    console.log(body);
    try {
      const res = await axios.post(
        `http://localhost:5000/api/v1/category/`,
        body,
        config
      );
      alert("Added");
    } catch (err) {
      console.log("Can't load the items");
    }
  };
  render() {
    return (
      <div className="modal show product-view" id="quickModel" role="dialog">
        <div className="modal-dialog">
          <div className="modal-header">
            <h3>Doctor Name</h3>
            <button type="button" className="close" data-dismiss="modal">
              &times;
            </button>
          </div>
          <div className="modal-dialog product-big-img">
            <div className="product-top">
              <img
                src="data:image/png;base64,"
                className="img1"
                alt=""
              />

              <h3>Doctor Name</h3>
              <h4>Specialization</h4>
              <h4>Fees</h4>

              <div className="product-bottom text-center"></div>

              <div class="container">
                <div id="Checkout" class="inline">
                  <h1>Pay Invoice</h1>
                  <div class="card-row">
                    <span class="visa"></span>
                    <span class="mastercard"></span>
                    <span class="amex"></span>
                    <span class="discover"></span>
                  </div>
                  <form>
                    <div class="form-group">
                      <label for="PaymentAmount">Payment amount</label>
                      <div class="amount-placeholder">
                        <span>$</span>
                        <span>500.00</span>
                      </div>
                    </div>
                    <div class="form-group">
                      <label or="NameOnCard">Name on card</label>
                      <input
                        id="NameOnCard"
                        class="form-control"
                        type="text"
                        maxlength="255"
                      ></input>
                    </div>

                    <button
                      id="PayButton"
                      class="btn btn-block btn-success submit-button"
                      type="submit"
                    >
                      <span class="submit-button-lock"></span>
                      <span class="align-middle">Pay $500.00</span>
                    </button>
                  </form>
                </div>
              </div>
            </div>
            <div className="overlay">
              <button
                type="button"
                className="btn btn-secondary"
                title="Quick Shop"
                data-toggle="modal"
                data-target="#quickModel"
              >
                <i className="fa fa-eye"></i>
              </button>

              <button
                type="button"
                className="btn btn-secondary"
                title="Add to Cart"
                data-toggle=""
                data-target=""
              >
                <i className="fa fa-shopping-cart"></i>
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
